module.exports = "<h2 class=\"titleMargin\">NUU Player Resources</h2>\r\n<div class=\"col-sm-9\">\r\n  <h4>Private Goalkeeper Training</h4>\r\n  <p>Learn correct techniques for catching, diving, jumping as well how to handle crosses, breakaways, and various forms of\r\n    distribution that will bring your game to the next level and help you make that game changing save!!!</p>\r\n  <p>Coach Will Camerlingo is a graduate student at USU majoring in physical education and holds an elementary school teaching\r\n    license. Along his career he has had the awesome opportunity to work with and learn from the most qualified and professional\r\n    athletes and coaches to bring the best goalkeeping training to this area. Will hopes to share what he has learned to\r\n    bring your game to the next highest level!</p>\r\n  <p>* 2002, 2003 NJ Group 1 State Champion * 2004 NJ Group1 State Runner up *2002, 2003, 2004 NJ Group 1 Sectional Champion\r\n    * Multiple MVP and All-State Awards *4 year NCAA team captain *Playing experience in Germany, Austria, Belgium, and Holland\r\n    * 2010 ranked 1st in CACC conference *2010 ranked 5th on NCAA division 2 national leaderboards *2010 All-American nominated\r\n    * Led youth teams to finish first in season and a community college to reach their regional tournament final.</p>\r\n  <p>Contact Will to set up training dates and times. Training will take place outdoors once the weather breaks and snow is\r\n    off the ground.</p>\r\n  <p><strong>Phone: </strong>908-763-8581</p>\r\n  <p><strong>Email: </strong><a href=\"mailto:camerlingo.will@gmail.com\">camerlingo.will@gmail.com</a></p>\r\n  <p><strong>Private:</strong> (1 or 2 goalkeepers) $35/player/hour. Group (3-6 goalkeepers) $20/player/hour.</p>\r\n</div>\r\n<div class=\"col-sm-12\">\r\n  <h3>Articles</h3>\r\n  <!--same as downloads, use jquery to make these look fancy and nice-->\r\n</div>\r\n<div class=\"col-lg-9\">\r\n  <div class=\"list-group\">\r\n    <a href=\"http://lowerislandsoccer.com/Video/OffsideInteractive.swf\" class=\"list-group-item\">\r\n      <h4 class=\"list-group-item-heading\">Offside Rule Video</h4>\r\n      <p class=\"list-group-item-text\">This video explains the offside rule that everyone will understand!</p>\r\n    </a>\r\n    <!--<a href=\"http://northernutahunited.com/articles/nuu-articles/preparing_for_tryouts.html\" class=\"list-group-item\">\r\n      <h4 class=\"list-group-item-heading\">Players Preparing For Tryouts</h4>\r\n      <p class=\"list-group-item-text\">As a player have you ever wondered what a coach is looking for in a player at the club/team tryouts? If so or if you're\r\n        just looking for some good advice on how to prepare for and approach the coming tryout season you may want to consider\r\n        the advice from the following coaches.</p>\r\n    </a>-->\r\n    <a href=\"http://bit.ly/12gJpuF\" class=\"list-group-item\">\r\n      <h4 class=\"list-group-item-heading\">Tryouts: Coping with Cuts</h4>\r\n      <p class=\"list-group-item-text\">By Tony DiCicco | The most difficult part of coaching isn't dealing with losses, it's cutting or rejecting people from\r\n        the team. It's not just a simple matter of reducing numbers, it's a matter of making decisions that in essence short-circuit\r\n        the dreams of players. I don't think there's any coach, either at the professional level or the youth recreational\r\n        league in a small town, who doesn't feel the pain of not choosing someone or cutting someone from the team.</p>\r\n    </a>\r\n  </div>\r\n</div>\r\n"

